
DROP DATABASE IF EXISTS dbVerein;
CREATE DATABASE dbVerein;

use dbVerein;

CREATE TABLE Ort (
	Ort_Id INTEGER NOT NULL AUTO_INCREMENT,
	PLZ Varchar(10) NOT NULL,
	Ort Varchar(30) NOT NULL,
	CONSTRAINT PrimaryKey PRIMARY KEY (Ort_Id)
)ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE latin1_german1_ci;

CREATE TABLE Mitglied (
	M_Id INTEGER NOT NULL AUTO_INCREMENT,
	Vorname Varchar(20) NOT NULL,
	Nachname Varchar(20) NOT NULL,
	Geburtsdatum DATETIME,
	Geschlecht Varchar(1) NOT NULL,
	Strasse Varchar(30) NOT NULL,
	Ort_Id INTEGER,
	Tel Varchar(20) NOT NULL,
	Eintrittsdatum DATETIME,
	CONSTRAINT PrimaryKey PRIMARY KEY (M_Id),
	CONSTRAINT PLZMitglieder FOREIGN KEY (Ort_Id) REFERENCES Ort (Ort_Id)
)ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE latin1_german1_ci;



CREATE TABLE Sportart (
	Sport_Id INTEGER NOT NULL AUTO_INCREMENT,
	Sportart Varchar(20) NOT NULL,
	Beitrag NUMERIC(6,2),
	CONSTRAINT PrimaryKey PRIMARY KEY (Sport_Id)
)ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE latin1_german1_ci;

CREATE TABLE Link_Mitglied_Sportart (
	M_Id INTEGER,
	Sport_ID INTEGER,
	CONSTRAINT PrimaryKey PRIMARY KEY (M_Id, Sport_Id),
	CONSTRAINT Link_Mitglied_Sportart_M_ID FOREIGN KEY (M_Id) REFERENCES Mitglied (M_Id),
	CONSTRAINT Link_Mitglied_Sportart_S_ID FOREIGN KEY (Sport_ID) REFERENCES Sportart (Sport_ID)
)ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE latin1_german1_ci;





